import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

import { Admin } from 'src/app/model/admin';
import { AdminService } from 'src/app/service/admin.service';

@Component({
  selector: 'app-admin-list',
  templateUrl: './admin-list.component.html',
  styleUrls: ['./admin-list.component.css']
})
export class AdminListComponent implements OnInit {
  admins: Admin[];
  constructor(private adminService: AdminService, private router: Router) { }

  ngOnInit(): void {
    this.getAdmins();
  }

  getAdmins(){
    this.adminService.getAdminList().subscribe(data => {
      this.admins = data;

      for(let i=0; i<this.admins.length; i++){
        this.admins[i]['type']="password";
        this.admins[i]['bname']="Show";
      }
      console.log(this.admins);
    });
  }

  updateAdmin(id: number){
    console.log(id);
    this.router.navigate(['/landing-page/update-admin', id]);
  }

  deleteAdmin(id: number){
    // console.log(id);
    // this.router.navigate(['/landing-page/delete-user', id]);
    this.adminService.deleteAdmin(id).subscribe(
      data => {
        console.log(data);
        this.getAdmins();
      }, error => {
        console.log("Not Delete")
      }
    )
  }



  showpassword(type:any,index:any){
    // this.admins[index].type='text'

    if(type=='text'){
      this.admins[index].type='password'
      this.admins[index].bname='Show'
    } else{
      this.admins[index].type='text'
      this.admins[index].bname='Hide'
    }

  }

}
<div class="container">

  <div class="row justify-content-center mt-5">
    <h1> <u>Admin List</u> </h1>
  </div>
  <button routerLink="/landing-page/create-admin" class="btn btn-primary ml-auto ml-5 mb-3">
    Add Admin
  </button>
<table class="table table-striped " style="margin-bottom: 100px;">
  <thead>
    <tr>
      <th>Admin Id</th>
      <th>Admin Name</th>
      <th>Contact No</th>
      <th>Email</th>
      <th>Password</th>
      <th>Actions</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let admin of admins; let i=index">
      <td>{{admin.adminId}}</td>
      <td>{{admin.adminName}}</td>
      <td>{{admin.contactNumber}}</td>
      <td>{{admin.email}}</td>
      <td><input name="{{i}}" readonly type="{{admin.type}}" [ngStyle]="{backgroundColor: i%2==0  ? '#f2f2f2' : 'white'}" [(ngModel)]="admin.password"  style="outline: none;border: none; " />
      <button (click)="showpassword(admin.type,i)">{{admin.bname}}</button></td>
      <td>
        <button button (click) = "updateAdmin(admin.adminId)" class="btn btn-info" >Update</button>
        <button button (click) = "deleteAdmin(admin.adminId)" class="btn btn-danger" style="margin-left: 2px;" >Delete</button>
      </td>
    </tr>
  </tbody>
</table>

</div>
